import React, { useState } from 'react'
import './signIn.css'

const API = process.env.REACT_APP_FORM;

const SignIn = () => {

    // Company
    // Professor
    // Student 
    // Manager
    // Person 

    // Id User
    // Name
    // Email
    // Password
    // Address

    const [name, setName] = useState("");
    const [lastname, setlastName] = useState("");
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")
    const [addressZipCode, setAddressZipCode] = useState("")
    const [addressStreet, setAddressStreet] = useState("")
    const [addressCity, setAddressCity] = useState("")
    const [addressContry, setAddressContry] = useState("")
    const [addressDeparment, setAddressDeparment] = useState("")
    const [type, setType] = useState("")

    const handleSubmit = async (e) => {
        e.preventDefault();
        const res = await fetch(`${API}/signIn${type}`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                name,
                lastname,
                email,
                password,
                address,
            })
        })
        const data = await res.json();
        console.log(data)
    }

    return (
        <div className='signin-whole'>
            <div className='signin-form'>
                <form onSubmit={handleSubmit} className='signin-form_body'>
                    <h1>GET IN AS YOU PLEASE</h1>
                    <div className='signin-form_body-input'>
                        <label>Name</label>
                        <input
                        type='text'
                        onChange={e => setName(e.target.value)}
                        value={name}
                        className='form-control'
                        placeholder='Name'
                        autoFocus/>
                    </div>
                    <div className='signin-form_body-input'>
                        <label>Last Name</label>
                        <input
                        type='text'
                        onChange={e => setlastName(e.target.value)}
                        value={lastname}
                        className='form-control'
                        placeholder='Last Name'
                        autoFocus/>
                    </div>
                    <div className='signin-form_body-input'>
                        <label>Email</label>
                        <input
                        type='text'
                        onChange={e => setEmail(e.target.value)}
                        value={email}
                        className='form-control'
                        placeholder='Email'/>
                    </div>
                    <div className='signin-form_body-input'>
                        <label>Password</label>
                        <input
                        type='password'
                        onChange={e => setPassword(e.target.value)}
                        value={password}
                        placeholder='Password'/>
                    </div>
                    <div className='signin-form_body-input'>
                        <label>Address</label>
                        <input
                        type='text'
                        onChange={e => setAddressZipCode(e.target.value)}
                        value={address}
                        placeholder='Zip Code'
                        />
                        <input
                        type='text'
                        onChange={e => setAddressStreet(e.target.value)}
                        value={address}
                        placeholder='Street'
                        />
                        <input
                        type='text'
                        onChange={e => setAddressCity(e.target.value)}
                        value={address}
                        placeholder='City'
                        />
                        <input
                        type='text'
                        onChange={e => setAddressContry(e.target.value)}
                        value={address}
                        placeholder='Contry'
                        />
                        <input
                        type='text'
                        onChange={e => setAddress(e.target.value)}
                        value={address}
                        placeholder='Department'
                        />
                    </div>
                    <div className='signin-form_body-input'>
                        <label>Account Type</label>
                        <select onChange={e => setType(e.target.value)}>
                                <option selected disabled>Category:</option>
                                <option value="student">Student</option>
                                <option value="company">Company</option>
                                <option value="professor">Professor</option>
                                <option value="manager">Manager</option>
                                <option value="person">Person</option>
                        </select> 
                    </div>
                    <button className="signin-form_body-input">
                        Next
                    </button>
                </form>
            </div>
        </div>
    )
}

export default SignIn;
